import './App.css';
import Navbar from './components/Navbar'
import Home from './components/Home'
import AboutView from './components/AboutView'
import {Switch,Route} from 'react-router-dom'


function App() {
  return (
    <div>
      <Navbar />
      <switch>
       <Route path="/" exact>
          <Home />
        </Route> 
        <Route path="/about" component={AboutView} />
      <AboutView />
      </switch>
    </div>
  );
}

export default App;
